from ip2geotools.databases.noncommercial import DbIpCity
import pandas as pd

"""The below function is used to print the details of the IP address line City, Country, Coordinates, etc."""

def extractIp(ip):
    response = DbIpCity.get(ip, api_key='free')
    return response.to_csv(",")

"""**2. Generating random IP addresses the Location to create a synthetic dataset for visualization**

generate random ip address using random module: https://bobbyhadz.com/blog/python-generate-random-ip-address
"""

from random import randint

# random ip address generator function
def generate_random_ip():
    return '.'.join(
        str(randint(0, 255)) for _ in range(4)
    )

"""generate the ip addresses and add to the empty list."""

ip_address = [] # emptlist to hold the ip address

for i in range(150):
  ip_address.append(str(generate_random_ip()))

# empty list to hold country names etc.
